# Novomusino, Chishminsky District, Republic of Bashkortostan

}}
Novomusino (; , Yañı Musa) is a rural locality (a selo) in Novotroitsky Selsoviet, Chishminsky District, Bashkortostan, Russia. The rural locality has 2 streets and, as of 2010, a population of 222.
Geography
Novomusino is 24 km southeast of Chishmy, the district's administrative centre. Novotroitskoye is the nearest rural locality.
